(3, 'Rodent', 'male', 'Hammie', 'https://images.theconversation.com/files/224977/original/file-20180626-112611-1uf34g4.jpg?ixlib=rb-1.1.0&q=45&auto=format&w=1200&h=1200.0&fit=crop', '0.20', '0.650', 'Хом\'яки — підродина ссавців з родини Хом\'якові надряду Гризуни, широко поширені на багатьох континентах. Хом\'яки є вихідною групою в еволюції щурових, вкл. щурів, нориць, полівок, лемінгів, строкаток та ін.', 10, NULL),
(4, 'Dog', 'male', 'Dorottie', 'https://post.medicalnewstoday.com/wp-content/uploads/sites/3/2020/02/322868_1100-1100x628.jpg', '2.00', '2.300', 'Dogs, often hailed as humans’ best friends, have been the topic of many scientific studies looking into how they might boost our well-being. In this Spotlight, we’ll explain how your friendly pup can benefit your health across the board.', 8, 4);
